//db_handling
let db={};
export function addToPlaylist(song,playlist){
    try{
    playlist.append(song);
    }
    catch (e){
    console.log(e.message)
    }
}
export function removeFromPlaylist(song,playlist){
    try{
        playlist.delete(song);
    }
    catch(e){
        console.log(e.message)
    }
}
export function newPlaylist(name){
    try{
        db['playlists'].append({name,value:null});
    }
    catch (e){
        console.log(e.message)
    }
}
export function deletePlaylist(name){
    try{
    db['playlists'].delete(name);
    }
    catch (e) {
        console.log(e.message)
    }
}
